import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { Lead } from '../../models/lead.model';
import { LeadService } from '../../services/lead.service';

@Component({
  selector: 'app-lead-list',
  templateUrl: './lead-list.component.html',
  styleUrls: ['./lead-list.component.scss']
})
export class LeadListComponent implements OnInit {
  leads: Lead[] = [];
  filteredLeads: Lead[] = [];
  isLoading = true;
  error = '';

  // Filtering
  searchTerm = '';
  filterScore = 0;

  // Sorting
  sortField = 'createdAt';
  sortDirection = 'desc';

  constructor(
    private leadService: LeadService,
    private router: Router
  ) { }

  ngOnInit(): void {
    this.loadLeads();
  }

  loadLeads(): void {
    this.isLoading = true;
    this.error = '';

    this.leadService.getAllLeads().subscribe({
      next: (response) => {
        if (response.success && response.data) {
          this.leads = response.data;
          this.applyFilters();
        } else {
          this.error = 'Failed to load leads data';
        }
        this.isLoading = false;
      },
      error: (error) => {
        this.error = error.message || 'An error occurred while loading leads';
        this.isLoading = false;
      }
    });
  }

  applyFilters(): void {
    // First filter by search term
    let filtered = this.leads;

    if (this.searchTerm) {
      const term = this.searchTerm.toLowerCase();
      filtered = filtered.filter(lead => 
        (lead.name && lead.name.toLowerCase().includes(term)) ||
        (lead.email && lead.email.toLowerCase().includes(term)) ||
        (lead.company && lead.company.toLowerCase().includes(term)) ||
        (lead.industry && lead.industry.toLowerCase().includes(term))
      );
    }

    // Then filter by qualification score
    if (this.filterScore > 0) {
      filtered = filtered.filter(lead => {
        const score = parseInt(lead.qualificationScore as string, 10);
        return score >= this.filterScore;
      });
    }

    // Apply sorting
    filtered = this.sortLeads(filtered);

    this.filteredLeads = filtered;
  }

  sortLeads(leads: Lead[]): Lead[] {
    return leads.sort((a, b) => {
      let valueA = a[this.sortField as keyof Lead] || '';
      let valueB = b[this.sortField as keyof Lead] || '';

      // Handle numeric values
      if (this.sortField === 'qualificationScore') {
        valueA = parseInt(valueA as string, 10) || 0;
        valueB = parseInt(valueB as string, 10) || 0;
      }

      // Handle date values
      if (this.sortField === 'createdAt') {
        valueA = new Date(valueA as string).getTime() || 0;
        valueB = new Date(valueB as string).getTime() || 0;
      }

      // Compare based on direction
      if (this.sortDirection === 'asc') {
        return valueA > valueB ? 1 : -1;
      } else {
        return valueA < valueB ? 1 : -1;
      }
    });
  }

  onSearch(): void {
    this.applyFilters();
  }

  onFilterScoreChange(score: number): void {
    this.filterScore = score;
    this.applyFilters();
  }

  onSort(field: string): void {
    // If clicking the same field, toggle direction
    if (this.sortField === field) {
      this.sortDirection = this.sortDirection === 'asc' ? 'desc' : 'asc';
    } else {
      this.sortField = field;
      this.sortDirection = 'desc'; // Default to desc for new field
    }

    this.applyFilters();
  }

  viewLead(id: string): void {
    this.router.navigate(['/leads', id]);
  }

  exportLeads(): void {
    this.leadService.exportLeadsToCSV().subscribe({
      next: (blob) => {
        const url = window.URL.createObjectURL(blob);
        const a = document.createElement('a');
        a.href = url;
        a.download = `leads-export-${new Date().toISOString().slice(0, 10)}.csv`;
        document.body.appendChild(a);
        a.click();
        window.URL.revokeObjectURL(url);
        a.remove();
      },
      error: (error) => {
        this.error = error.message || 'Failed to export leads';
      }
    });
  }

  // Helper method to get score class based on value
  getScoreClass(score: number): string {
    if (score >= 80) return 'high-score';
    if (score >= 60) return 'medium-score';
    return 'low-score';
  }
}
<div class="lead-list-container">
  <div class="container">
    <div class="lead-list-header">
      <div class="header-title">
        <h1 class="lead-list-title">Lead Management</h1>
        <p class="lead-list-subtitle">View and manage all your captured leads</p>
      </div>
      <div class="header-actions">
        <button class="btn btn-primary" routerLink="/add-lead">
          <span class="material-icons">add</span>
          Add New Lead
        </button>
        <button class="btn btn-outline" (click)="exportLeads()">
          <span class="material-icons">download</span>
          Export CSV
        </button>
      </div>
    </div>

    <div class="card">
      <div class="lead-filter-bar">
        <div class="search-box">
          <input 
            type="text" 
            placeholder="Search leads..." 
            [(ngModel)]="searchTerm"
            (keyup.enter)="onSearch()"
            class="form-control">
          <button class="search-btn" (click)="onSearch()">
            <span class="material-icons">search</span>
          </button>
        </div>

        <div class="filter-options">
          <div class="filter-group">
            <label>Min. Score:</label>
            <select 
              class="form-control" 
              [(ngModel)]="filterScore" 
              (change)="onFilterScoreChange(filterScore)">
              <option [value]="0">All Leads</option>
              <option [value]="80">High Quality (80+)</option>
              <option [value]="60">Medium Quality (60+)</option>
              <option [value]="40">Low Quality (40+)</option>
            </select>
          </div>

          <button class="btn btn-outline btn-sm" (click)="loadLeads()">
            <span class="material-icons">refresh</span>
            Refresh
          </button>
        </div>
      </div>

      <div *ngIf="isLoading" class="loading-indicator">
        <div class="spinner"></div>
        <p>Loading leads...</p>
      </div>

      <div *ngIf="error" class="alert alert-error">
        <div class="alert-icon">
          <span class="material-icons">error</span>
        </div>
        <div class="alert-content">
          <h4>Error Loading Leads</h4>
          <p>{{ error }}</p>
        </div>
      </div>

      <div *ngIf="!isLoading && !error" class="lead-table-container">
        <table class="lead-table" *ngIf="filteredLeads.length > 0">
          <thead>
            <tr>
              <th (click)="onSort('name')">
                Name
                <span class="sort-icon" *ngIf="sortField === 'name'">
                  <span class="material-icons">{{ sortDirection === 'asc' ? 'arrow_upward' : 'arrow_downward' }}</span>
                </span>
              </th>
              <th (click)="onSort('company')">
                Company
                <span class="sort-icon" *ngIf="sortField === 'company'">
                  <span class="material-icons">{{ sortDirection === 'asc' ? 'arrow_upward' : 'arrow_downward' }}</span>
                </span>
              </th>
              <th (click)="onSort('industry')">
                Industry
                <span class="sort-icon" *ngIf="sortField === 'industry'">
                  <span class="material-icons">{{ sortDirection === 'asc' ? 'arrow_upward' : 'arrow_downward' }}</span>
                </span>
              </th>
              <th (click)="onSort('qualificationScore')">
                Score
                <span class="sort-icon" *ngIf="sortField === 'qualificationScore'">
                  <span class="material-icons">{{ sortDirection === 'asc' ? 'arrow_upward' : 'arrow_downward' }}</span>
                </span>
              </th>
              <th (click)="onSort('createdAt')">
                Date
                <span class="sort-icon" *ngIf="sortField === 'createdAt'">
                  <span class="material-icons">{{ sortDirection === 'asc' ? 'arrow_upward' : 'arrow_downward' }}</span>
                </span>
              </th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            <tr *ngFor="let lead of filteredLeads">
              <td>
                <div class="lead-name">{{ lead.name }}</div>
                <div class="lead-email">{{ lead.email }}</div>
              </td>
              <td>
                <div class="lead-company">{{ lead.company }}</div>
                <div class="lead-position">{{ lead.position }}</div>
              </td>
              <td>{{ lead.industry }}</td>
              <td>
                <div class="qualification-score" [ngClass]="getScoreClass(lead.qualificationScore)">
                  {{ lead.qualificationScore }}
                </div>
              </td>
              <td>{{ lead.createdAt | date:'MMM d, y' }}</td>
              <td>
                <button class="btn-icon" (click)="viewLead(lead.id)">
                  <span class="material-icons">visibility</span>
                </button>
              </td>
            </tr>
          </tbody>
        </table>

        <div *ngIf="filteredLeads.length === 0" class="no-leads">
          <div class="no-data-icon">
            <span class="material-icons">search_off</span>
          </div>
          <h3>No leads found</h3>
          <p>Try adjusting your search criteria or add new leads.</p>
          <button class="btn btn-primary" routerLink="/add-lead">Add New Lead</button>
        </div>
      </div>
    </div>
  </div>
</div>
